(23, 'Materiales', 'materiales', '<h3>DEBERES Y DERECHOS DEL EMPLEADO DE LA ADMINISTRACI&Oacute;N P&Uacute;BLICA PROVINCIAL.</h3><h3>ASPECTOS INTRODUCTORIOS</h3><p><a href="../../../uploads/publicacion/4b8b9e2fdfb54f1150f7079d582624e8da019b83.pdf" target="_blank">R&eacute;gimen de Licencias</a></p><p><a href="../../../uploads/publicacion/bdcb8c46cb353f61aed4fa27a5c2b56f738f86e6.pdf" target="_blank">Ley N&ordm; 3521 - Resumen </a></p><p><a href="../../../uploads/publicacion/6fd57f0f4dfcb9c7686232598ef3a2649e77a95e.pdf" target="_blank">Ley N&ordm; 2017 y Ley N&ordm; 1276</a></p><h3>PROCEDIMIENTO ADMINISTRATIVO - Colonizaci&oacute;n</h3><h3><a href="../../../uploads/publicacion/22d14e670f0033f29b6b4ef8b5b05c0d2c3f4381.pdf" target="_blank">Instituto de Colonizaci&oacute;n</a></h3><h3><a href="../../../uploads/publicacion/2f231535e80471ff2c034d67f05f39bc494c4238.pdf" target="_blank">Sumario Administrativo</a></h3><h3><a href="../../../uploads/publicacion/5bef474e2bb54f5826c14df1c823bbb1f1b95f8a.pdf" target="_blank">Actos y Recursos Administrativos</a></h3><h3>Eje Legislativo - T&eacute;cnicas Parlamentarias&nbsp;</h3><p><strong><a href="../../../uploads/publicacion/cfd883a0576b95bba45c8a8e44d69ddf6ca62fd1.pdf" target="_blank">Eje Legislativo - T&eacute;cnicas Parlamentarias</a></strong></p><h3>An&aacute;lisis y redacci&oacute;n de documentos e instrumentos administrativos.</h3><h3><a href="../../../uploads/publicacion/087e5530ca1868c4187fb4442f9da4a46b8a0983.pdf" target="_blank">Clase 1</a></h3><p><a href="../../../uploads/publicacion/091ef6a9d306f1c9825510ce56cecba1f4b80cfd.pdf" target="_blank">Decreto 2015/77</a></p><p><a href="../../../uploads/publicacion/91fb23ee2a51ee614f28ce65a398d0f2e4161d16.pdf">Decreto 3553/08</a></p><p><a href="../../../uploads/publicacion/b0ad7ac2486829621c09842e22e2c76a631ca4f5.pdf" target="_blank">Manual: Lenguaje Claro</a></p><p><a href="../../../uploads/publicacion/7a252d410c85d7c4e61c12697f2959da1217475e.pdf" target="_blank">Providencia</