(27, 'Programa de Orientación para la Actividad Pasiva', 'prejubilatorio', '<h4>El IPAP Chaco desde 2015 ofrece el siguiente programa a agentes p&uacute;blicos que se encuentran en condiciones de acceder a los beneficios jubilatorios.</h4><p>&nbsp;<a href="../../../uploads/publicacion/d92fbfa86ace477541bd64c39c4109a52482019b.pdf">CREACI&Oacute;N DEL PROGRAMA</a></p><p>El Instituto se propone acompa&ntilde;ar a los empleados p&uacute;blicos en el proceso pre-jubilatorio, para ello ofrece talleres en el que se abordan tem&aacute;ticas especificas tales como:</p><ul><li>Salud f&iacute;sica y psicol&oacute;gica.</li><li>La administraci&oacute;n econ&oacute;mica y financiera, micro emprendimientos, gesti&oacute;n del dinero.</li><li>El conocimiento de la normativa vigente asociada a la jubilaci&oacute;n y de seguridad social.</li><li></li></ul><p style="text-align: center;"><strong>COMUNICATE E INFORMATE<br /></strong></p><p style="text-align: center;">(+54) 362-4453723<br />Arturo Illia 26 Planta Baja. Edificio Olivetti. Resistencia - Chaco, Argentina</p><p style="text-align: center;">&nbsp;LUNES A VIERNES DE 7 A 20HS<br /><br /></p>'),
