(29, 'Cursos de Ofimática', 'cursos_ofimatica', '<p><strong>IMPORTANTE:</strong> Eval&uacute;e el d&iacute;a y horario conveniente para capacitarse y luego inscr&iacute;base a uno de los cursos. Entregue el formulario generado por el sistema, a la mayor brevedad,&nbsp;para completar su inscripci&oacute;n.</p><p>Las inscripciones se encontrar&aacute;n abiertas <strong>hasta el 01/03/2016 a las 13hs,</strong> o hasta agotarse los cupos, lo que suceda primero.&nbsp;</p><table style="height: 604px; width: 1022px;" border="black" width="927"><tbody><tr><th style="text-align: center;"><strong>CURSO</strong></th><th style="text-align: center;"><strong>D&Iacute;AS Y HORARIOS</strong></th><th style="text-align: center;"><strong>CRONOGRAMA</strong></th><th style="text-align: center;"><strong>PRE-INSCRIPCI&Oacute;N</strong></th></tr><tr><td><strong>1. WORD B&Aacute;SICO</strong> &nbsp; &nbsp;</td><td>Martes y jueves de 7.30 a 10 hs</td><td><table width="442"><tbody><tr><td><p><strong>MARTES</strong></p></td><td><p><strong>JUEVES</strong></p></td></tr><tr><td><p><strong>INICIO 07/03</strong></p></td><td><p>09/03</p></td></tr><tr><td><p>14/03</p></td><td><p>16/03</p></td></tr><tr><td><p>21/03</p></td><td><p>23/03</p></td></tr><tr><td><p>28/03</p></td><td><p>30/03</p></td></tr><tr><td><p>4/04</p></td><td><p><strong>EVALUACI&Oacute;N 6/04</strong></p></td></tr></tbody></table></td><td>&nbsp;<a href="../../../alumno/curso/inscripcion/219">Ingrese aqu&iacute;</a></td></tr><tr><td><strong>2. WORD B&Aacute;SICO &nbsp;</strong> &nbsp;</td><td>Martes y jueves de 14 a 16.30 hs</td><td><table width="442"><tbody><tr><td><p><strong>MARTES</strong></p></td><td><p><strong>JUEVES</strong></p></td></tr><tr><td><p><strong>INICIO 07/03</strong></p></td><td><p>09/03</p></td></tr><tr><td><p>14/03</p></td><td><p>16/03</p></td></tr><tr><td><p>21/03</p></td><td><p>23/03</p></td></tr><tr><td><p>28/03</p></td><td><p>30/03</p></td></tr><tr><td><p>4/04</p></td><td><p><strong>EVALUACI&Oacute;N 6/04</strong