INSERT INTO `test_alumno_respuestas` (`test_alumno_id`, `id`, `pregunta`, `respuesta`, `verificacion`, `test_preguntas_id`, `test_opciones_id`) VALUES
(25, 249, 'Luego de resolver la consigna 2.1) para aplicar el sombreado color azul al texto hice: ', 'Posicioné el cursor en la celda, luego en la ficha Inicio elegí dentro de Párrafo el color sombreado.', 'VERDADERO', 15, 90),
(25, 250, 'Para guardar los cambios en el documento de Word Notas_TPI_Apellido hice lo siguiente:	', 'Click en el ícono Guardar que se encuentra en la barra de acceso rápido.', 'VERDADERO\r\n', 16, 94),
(26, 251, 'Luego de resolver la consigna 1.1) para configurar los márgenes de la página hice:	', 'Click en la ficha Diseño de página, después click en Márgenes y una vez allí hice click en márgenes personalizados para colocar los márgenes solicitados.', 'VERDADERO', 11, 62),
(26, 252, 'Luego de resolver la consigna 1.1) para configurar el tamaño de la página hice:', 'Click en la ficha Diseño de página y luego click en Tamaño seleccionando el solicitado.', 'VERDADERO', 12, 67),
(26, 253, 'Luego de resolver la consigna 2.1) para centrar la Tabla respecto de la hoja hice:		', 'Seleccioné la tabla haciendo click en la cruz que aparece en el extremo superior izquierdo de la misma (como se muestra en la imagen), y luego hice click en Alineación Centrar.\r\n</br><img src="documentos/MSWORD-AVANZADO/images/azul.jpg" alt="Seleccionar tabla" width="50">', 'VERDADERO', 13, 77),
(26, 254, 'Luego de resolver la consigna 2.1) para combinar las celdas de la primera fila de la tabla hice:', 'Seleccioné las dos celdas, hice click con el botón derecho del mouse sobre la selección y elegí la opción Combinar celdas.', 'VERDADERO', 14, 83),
(26, 255, 'Luego de resolver la consigna 2.1) para aplicar el sombreado color azul al texto hice: ', 'Posicioné el cursor en la celda, hice click con el botón derecho del mouse elegí la opción Bordes y Sombreado, y allí apliqué color del Relleno a la celda solicitada.', 'VERDADERO', 15, 86),
(26, 256, 'Para guardar los cambios en el documento de Word Notas_TPI_Apellido hice lo siguiente:	', 'Click en <img src="documentos/MSWORD-AVANZADO/images/windows.jpg" alt="windows" width="50"> y luego seleccioné la siguiente opción <img src="documentos/MSWORD-AVANZADO/images/guardar_como.jpg" alt="guardar como" width="150">', 'FALSO', 16, 96),
(27, 257, 'Luego de resolver la consigna 1.1) para configurar los márgenes de la página hice:	', 'Click en la ficha Diseño de página, después click en Márgenes y una vez allí hice click en márgenes personalizados para colocar los márgenes solicitados.', 'VERDADERO', 11, 62),
