(93, 671, 'Luego de resolver la consigna 2.1) para aplicar el sombreado color azul al texto hice: ', 'Seleccioné el texto y luego hice click en el siguiente ícono para seleccionar el color solicitado.\r\n</br><img src="documentos/MSWORD-AVANZADO/images/ab.jpg" alt="ab" width="50">', 'FALSO', 15, 85),
(93, 672, 'Para guardar los cambios en el documento de Word Notas_TPI_Apellido hice lo siguiente:	', 'Click en <img src="documentos/MSWORD-AVANZADO/images/windows.jpg" alt="windows" width="50"> y luego seleccioné la siguiente opción <img src="documentos/MSWORD-AVANZADO/images/guardar_como.jpg" alt="guardar como" width="150">', 'FALSO', 16, 96);
